import React from 'react';
import Menu from '../svg/menu.svg';
import Logo from '../img/logo.png';

const Hamburger = () => {
	return(
		<svg fill="white" version="1.1" xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 32 32">
			<title>menu</title>
			<path d="M2 6h28v6h-28zM2 14h28v6h-28zM2 22h28v6h-28z"></path>
		</svg>
	);
};

const SideNav = () => {
	return(
		<div className="navContainer">
			<nav className="navMain gridSingleVert">
				<img className="marginBottom" src={Logo} alt="" />
				<ul>
					<li>Home</li>
					<li>About</li>
					<li>Donate</li>
				</ul>
			</nav>
		</div>
	);
};

class Header extends React.Component {
	render() {
		return(
			<div>
				<header className="chrisHeader verticalCenterFlex">
					<div  className="clickIt ">
						<Hamburger  />
					</div>
				</header>
				<SideNav />
			</div>
		);
	}
}

export default Header;
